import React from 'react'
import logo from '../img/shopping-bag.png'
const Navbar = () => {
    return (
        <div>
            <div className="container">
                <div className="row">
                    <div className="col">

                        <nav className='navbar navbar-expand-lg'>

                            <a href="" className='navbar-brand'>
                                <img src={logo} alt="" />
                                <span>Attire</span>
                            </a>

                            <span className='nav-icon-btn'>
                                <button>
                                    <i className="fa fa-shopping-cart">
                                        <sup>9</sup>
                                    </i>
                                </button>

                                <button>
                                    <i className="fa fa-heart">
                                        <sup>2</sup>
                                    </i>
                                </button>

                                <button className='btn-search'>
                                    <i className="fa fa-search"></i>
                                </button>
                            </span>

                            <button className="navbar-toggler" data-bs-toggle='collapse' data-bs-target='#MyNavbarMenu'>

                                <span className='navbar-toggler-icon'></span>

                            </button>

                            <div className="collapse navbar-collapse" id='MyNavbarMenu'>
                                <ul className="navbar-nav">

                                    <li className="nav-item">
                                        <a href="" className="nav-link">Home</a>
                                    </li>
                                    
                                    <li className="nav-item">
                                        <a href="" className="nav-link">Collection</a>
                                    </li>
                                    <li className="nav-item">
                                        <a href="" className="nav-link">Popular</a>
                                    </li>
                                    <li className="nav-item">
                                        <a href="" className="nav-link">Blogs</a>
                                    </li>
                                    <li className="nav-item">
                                        <a href="" className="nav-link">Spacial</a>
                                    </li>
                                    <li className="nav-item">
                                        <a href="" className="nav-link">About us</a>
                                    </li>

                                </ul>
                            </div>

                        </nav>
                    </div>
                </div>
            </div>
        </div>



        // <div className="header">
